(15676, 'weapon_tysandy_blade_i00.png', 'Triumph Blade', NULL, '<Special Option><br/>Increases Critical by 78.9. Increases damage inflicted during PvP. Has a chance of recovering CP during an attack.<br/>No Soul Crystal option.', 'Меч Тайсенди', NULL, '<Особые свойства></br>Увеличение Шанса. Крит. Атк. на 78.9. Увеличивает урон в PvP и с определенным шансом восстанавливает CP.</br>Нельзя применить Кристалл Души.', 1, 1, 1, 'r', 'consume_type_normal'),
(15677, 'weapon_tysandy_dagger_i00.png', 'Triumph Dagger', NULL, '<Special Option><br/>Increases Critical by 82.1. Increases damage inflicted during PvP. Has a chance of inflicting additional damage during an attack.<br/>No Soul Crystal option.', 'Нож Тайсенди', NULL, '<Особые свойства></br>Увеличение Шанса. Крит. Атк. на 82.1. Увеличивает урон в PvP и с определенным шансом наносит дополнительный урон.</br>Нельзя применить Кристалл Души.', 1, 1, 1, 'r', 'consume_type_normal'),
(15678, 'weapon_tysandy_hammer_i00.png', 'Triumph Hammer', NULL, '<Special Option><br/>Increases Critical by 78.9. Increases damage inflicted during PvP. Has a chance of recovering CP during an attack.<br/>No Soul Crystal option.', 'Дубина Тайсенди', NULL, '<Особые свойства></br>Увеличение Шанса. Крит. Атк. на 78.9. Увеличивает урон в PvP и с определенным шансом восстанавливает CP.</br>Нельзя применить Кристалл Души.', 1, 1, 1, 'r', 'consume_type_normal'),
(15679, 'weapon_tysandy_crusher_i00.png', 'Triumph Crusher', NULL, '<Special Option><br/>Increases Critical by 78.9. Increases damage inflicted during PvP. Has a chance of inflicting additional damage during an attack.<br/>No Soul Crystal option.', 'Крушитель Тайсенди', NULL, '<Особые свойства></br>Увеличение Шанса. Крит. Атк. на 78.9. Увеличивает урон в PvP и с определенным шансом наносит дополнительный урон.</br>Нельзя применить Кристалл Души.', 1, 1, 1, 'r', 'consume_type_normal'),
(15680, 'weapon_tysandy_two_hand_sword_i00.png', 'Triumph Two Hand Sword', NULL, '<Special Option><br/>Increases Critical by 78.9. Increases damage inflicted during PvP. Has a chance of canceling 1 or more of the target\'s enhanced status, or of decreasing the target\'s Shield Defense during an attack.<br/>No Soul Crystal option.', 'Клинок Тайсенди', NULL, '<Особые свойства></br>Увеличение Шанса. Крит. Атк. на 78.9. Увеличивает урон в PvP и с определенным шансом снимает 1 положительный эффект у противника или снижает шанс блока щитом.</br>Нельзя применить Кристалл Души.', 1, 1, 1, 'r', 'consume_type_normal'),
(15681, 'weapon_tysandy_jamadhr_i00.png', 'Triumph Jamadhr', NULL, '<Special Option><br/>Increases Critical by 75.7. Increases damage inflicted during PvP. Has a chance of inflicting additional damage during an attack.<br/>No Soul Crystal option.', 'Коготь Тигра Тайсенди', NULL, '<Особые свойства></br>Увеличение Шанса. Крит. Атк. на 75.7. Увеличивает урон в PvP и с определенным шансом наносит дополнительный урон.</br>Нельзя применить Кристалл Души.', 1, 1, 1, 'r', 'consume_type_normal'),
(15682, 'weapon_tysandy_spear_i00.png', 'Triumph Spear', NULL, '<Special Option><br/>P. Atk. by 377. Increases damage inflicted during PvP. Has a chance of canceling 1 or more of the target\'s enhanced status, or of decreasing the target\'s Shield Defense during an attack.<br/>No Soul Crystal option.', 'Алебарда Тайсенди', NULL, '<Особые свойства></br>Физ. Атк. +377. Наносит дополнительный урон в PvP и с определенным шансом снимает 1 положительный эффект у противника или снижает шанс блока щитом.</br>Нельзя применить Кристалл Души.', 1, 1, 1, 'r', 'consume_type_normal'),
(15683, 'weapon_tysandy_staff_i00.png', 'Triumph Staff', NULL, '<Special Option><br/>Increases Casting Spd. by 15%. Increases damage inflicted during PvP. Has a chance of increasing Casting Spd. when attacked.<br/>No Soul Crystal option.', 'Булава Тайсенди', NULL, '<Особые свойства></br>Скор. Маг. +15%. Увеличивает урон в PvP и при получении повреждений с определенным шансом увеличивает Скор. Маг.</br>Нельзя применить Кристалл Души.', 1, 1, 1, 'r', 'consume_type_normal'),
(15684, 'weapon_tysandy_twohand_staff_i00.png', 'Triumph Two Hand Staff', NULL, '<Special Option><br/>Increases Casting Spd. by 15%. Increases damage inflicted during PvP. Has a chance of increasing Casting Spd. when attacked.<br/>No Soul Crystal option.', 'Посох Тайсенди', NULL, '<Особые свойства></br>Скор. Маг. +15%. Увеличивает урон в PvP и при получении повреждений с определенным шансом увеличивает Скор. Маг.</br>Нельзя применить Кристалл Души.', 1, 1, 1, 'r', 'consume_type_normal'),
