(15686, 'weapon_tysandy_bow_i00.png', 'Triumph Bow', NULL, '<Special Option><br/>Increases Critical by 78.9. Increases damage inflicted during PvP. Has a chance of increasing Atk. Spd. of bows/crossbows during an attack.<br/>No Soul Crystal option.', 'Лук Тайсенди', NULL, '<Особые свойства></br>Увеличение Шанса. Крит. Атк. на 78.9. Увеличивает урон в PvP и с определенным шансом увеличивает Скор. Атк. Луком / Арбалетом.</br>Нельзя применить Кристалл Души.', 1, 1, 1, 'r', 'consume_type_normal'),
