(15711, 'etc_charm_of_courage_i00.png', 'War Veteran Voucher', NULL, 'Document showing military service in the Seed of Annihilation region. Collect plenty of these and take them back to Soldier Ilvenis at the pier in the Seed of Annihilation to exchange for a reward.', 'Доказательство Подвигов', NULL, 'Доказательство Подвигов на территории Семени Уничтожения. Если собрать достаточное количество доказательств и отнести Солдату Ильвенису в Пристань Семени Уничтожения, можно получить хорошую награду.', 0, 0, 1, 'none', 'consume_type_stackable'),
